import React from 'react';
import moment from 'moment';


import UserLeaveItem from './UserItem/UserLeaveItem';
import './UserList.css';

const userLeaveList = props => {
  console.log("user leave list props", props.userLeave);
  const userLeave = props.userLeave.map(leave => {
  const userLeaveStartDate = new Date (leave.startDate).toLocaleDateString;
  const userLeaveEndDate = new Date(leave.endDate).toLocaleDateString;
  // const userLeaveStartDate = new Date (leave.startDate.substr(0,11)*1000);
  // const userLeaveEndDate = new Date(leave.endDate.substr(0,11)*1000);

    moment().format();
    console.log(`
      leave.startDate: ${leave.startDate},
      leave.endDate: ${leave.endDate},
      new Date(leave.startDate): ${new Date(leave.startDate)},
      new Date(leave.endDate): ${new Date(leave.endDate)},
      userLeaveStartDate: ${userLeaveStartDate},
      userLeaveEndDate: ${userLeaveEndDate},
      `);
      // const userLeaveStartDate = JSON.stringify(leave.startDate);
      // const userLeaveEndDate = JSON.stringify(leave.endDate);
      // const userLeaveStartDate = new Date(leave.startDate).toString();
  // const userLeaveEndDate = new Date(leave.endDate).toString();
    // const userLeaveStartDate = new Date(leave.startDate*1000).toUTCString();
    // const userLeaveEndDate = new Date(leave.endDate*1000).toUTCString();
    return (
      <UserLeaveItem
        key={leave.type}
        userId={props.authUserId}
        type={leave.type}
        startDate={leave.startDate}
        endDate={leave.endDate}
        description={leave.description}
      />
    );
  });

  return <ul className="user__list1">{userLeave}</ul>;
};

export default userLeaveList;
